import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Header from './Header';
import SolvedComplaints from '../src/components/SolvedComplaints';
import OpenComplaints from '../src/components/OpenComplaints';
import ComplaintForm from '../src/components/ComplaintForm';
import LoginPage from '../src/components/LoginPage';
import '../src/styles.css';

const App = () => {
  // Kullanıcı türünü burada tanımlayabilirsiniz. Örneğin:
  const userRole = 'admin'; // ya da 'normalUser' olarak değiştirebilirsiniz.

  return (
    <Router>
      <div className="App">
        <Header />
        <Routes>
          <Route path="/" element={<SolvedComplaints />} />
          <Route path="/open" element={<OpenComplaints />} />
          {userRole === 'admin' && (
            <Route path="/create_complaint" element={<ComplaintForm />} />
          )}
          {userRole === 'normalUser' && (
            <Route path="/user_complaints" element={<UserComplaints />} />
          )}
          <Route path="/login" element={<LoginPage />} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
